        "content": [
          "# MARKETING CAMPAIGN ANALYSIS - BUSINESS RULES & DEFINITIONS\n",
          "\n",
          "## Rules\n",
          "- Format currency as \"$X,XXX.XX\" with appropriate currency symbols\n",
          "- Display percentages with one decimal place (e.g., \"42.3%\") unless precision requires otherwise\n",
          "- Use \"K\" for thousands, \"M\" for millions, \"B\" for billions in summary text\n",
          "- Always convert dates to fiscal quarters (Q1 = Jan-Mar, Q2 = Apr-Jun, Q3 = Jul-Sep, Q4 = Oct-Dec)\n",
          "- For time-based questions without a period, default to current quarter\n",
          "- When comparing periods, calculate and show percentage change\n",
          "- Default to showing top 10 results for ranking questions unless specified otherwise\n",
          "- Round all financial figures to nearest dollar in detailed tables\n",
          "- Avoid using global date filters \">\" and \"<\" unless requested, and instead use the between operator\n",
          "\n",
          "## BUSINESS THRESHOLDS\n",
          "- HIGH_CTR: ≥ 0.05 (5%)\n",
          "- LOW_COST: < 2000 USD\n",
          "- HIGH_SPAM_RATE: ≥ 0.01 (1%)\n",
          "- HIGH_OPTOUT_RATE: ≥ 0.005 (0.5%)\n",
          "- HIGH_BOUNCE_RATE: ≥ 0.04 (4%)\n",
          "\n",
          "## BUSINESS CLASSIFICATIONS\n",
          "COMPLIANCE_RISK_CAMPAIGN: (unique_delivered ≥ 20) AND (spam_rate ≥ 0.01 OR optout_rate ≥ 0.005 OR bounce_rate ≥ 0.04)\n",
          "HIGH_PERFORMING_CAMPAIGN: (CTR ≥ 0.05) AND (cost < 3000)\n",
          "\n",
          "## DEVICE WEIGHTS\n",
          "- Mobile: 2.0, Tablet: 1.5, Laptop: 1.2, Desktop: 1.0 (baseline)\n",
          "- Smart TV: 0.8, E-reader: 0.5, Gaming Console: 0.3\n",
          "\n",
          "## METRIC CALCULATIONS\n",
          "\n",
          "### Click-Through Rate (CTR)\n",
          "CTR = unique_clicks / unique_delivered\n",
          "- Use DISTINCT contact_id when counting clicks and deliveries\n",
          "- Only include contacts who received at least one delivered email\n",
          "\n",
          "### Opt-out Rate\n",
          "Opt-out Rate = unique_optouts / unique_delivered\n",
          "- Use event_type = 'optout_click' for opt-outs\n",
          "- Use DISTINCT contact_id for counting\n",
          "\n",
          "### Spam Rate\n",
          "Spam Rate = unique_spam / unique_delivered\n",
          "- Use event_type = 'spam' for spam reports\n",
          "- Use DISTINCT contact_id for counting\n",
          "\n",
          "### Weighted CTR\n",
          "Weighted CTR = SUM(device_weight * clicks) / unique_delivered\n",
          "- Apply device weights to each click event\n",
          "- Divide by total unique delivered contacts\n",
          "\n",
          "## EDGE_CASE_HANDLING\n",
          "- ZERO_CLICKS_CPC: When clicks = 0, CPC = total campaign cost\n",
          "- ZERO_DENOMINATOR: When denominator = 0 in rate calculations, return NULL\n",
          "- MINIMUM_SAMPLE: Require at least 20 delivered emails for valid analysis\n",
          "- DUPLICATE_HANDLING: Use DISTINCT when counting contacts\n",
          "- COST_FORMAT: All costs in USD, round to 2 decimal places"
        ]
      }
