        "question": [
          "List all Compliance‑Risk campaigns that ran in Q1 2024, sorted by the highest spam‑rate"
        ],
        "sql": [
          "SELECT\n",
          "  c.campaign_id,\n",
          "  c.campaign_name,\n",
          "  COUNT(DISTINCT CASE WHEN e.event_type = 'delivered' THEN e.contact_id END) AS unique_delivered,\n",
          "  COUNT(DISTINCT CASE WHEN e.event_type = 'spam' THEN e.contact_id END) / \n",
          "    NULLIF(COUNT(DISTINCT CASE WHEN e.event_type = 'delivered' THEN e.contact_id END), 0) AS spam_rate\n",
          "FROM campaigns c\n",
          "JOIN events e ON c.campaign_id = e.campaign_id\n",
          "WHERE c.start_date >= '2024-01-01' AND c.end_date <= '2024-03-31'\n",
          "GROUP BY c.campaign_id, c.campaign_name\n",
          "HAVING COUNT(DISTINCT CASE WHEN e.event_type = 'delivered' THEN e.contact_id END) >= 20\n",
          "  AND (spam_rate >= 0.01 OR optout_rate >= 0.005 OR bounce_rate >= 0.04)\n",
          "ORDER BY spam_rate DESC"
        ]
      },
