        "question": [
          "Which campaigns have a high weighted CTR more than .5 but cost under 2,000 USD in Q1 2024?"
        ],
        "sql": [
          "WITH weighted_clicks AS (\n",
          "  SELECT \n",
          "    e.campaign_id,\n",
          "    SUM(CASE \n",
          "      WHEN ct.device = 'Mobile' THEN 2.0\n",
          "      WHEN ct.device = 'Tablet' THEN 1.5\n",
          "      WHEN ct.device = 'Laptop' THEN 1.2\n",
          "      WHEN ct.device = 'Desktop' THEN 1.0\n",
          "      ELSE 0.5\n",
          "    END) AS weighted_clicks,\n",
          "    COUNT(DISTINCT CASE WHEN e.event_type = 'delivered' THEN e.contact_id END) AS delivered\n",
          "  FROM events e\n",
          "  JOIN contacts ct ON e.contact_id = ct.contact_id\n",
          "  WHERE e.event_type = 'click'\n",
          "  GROUP BY e.campaign_id\n",
          ")\n",
          "SELECT c.campaign_id, c.campaign_name, wc.weighted_clicks/wc.delivered as weighted_ctr\n",
          "FROM campaigns c\n",
          "JOIN weighted_clicks wc ON c.campaign_id = wc.campaign_id\n",
          "WHERE c.cost < 2000 AND wc.weighted_clicks/wc.delivered > 0.5"
        ]
      },
