          "WITH funnel_metrics AS (\n",
          "  SELECT\n",
          "    COUNT(DISTINCT CASE WHEN e.event_type = 'sent' THEN e.contact_id END) AS sent,\n",
          "    COUNT(DISTINCT CASE WHEN e.event_type = 'delivered' THEN e.contact_id END) AS delivered,\n",
