          "    COUNT(DISTINCT CASE WHEN e.event_type = 'click' THEN e.contact_id END) AS clicked\n",
          "  FROM events e\n",
          "  WHERE e.event_date BETWEEN '2024-01-01' AND '2024-03-31'\n",
          ")\n",
          "SELECT \n",
          "  sent, delivered, opened, clicked,\n",
          "  delivered/sent AS delivery_rate,\n",
          "  opened/delivered AS open_rate,\n",
          "  clicked/opened AS click_rate\n",
          "FROM funnel_metrics"
