        "id": "01f0f247d69116acb339527cde721b82",
        "question": [
          "Show me the bottom 5 departments by engagement rate (CTR) for Q1 2024."
        ],
        "answer": [
          {
            "format": "SQL",
            "content": [
              "WITH events_with_contacts AS (\n",
              "  SELECT\n",
              "    `events`.*,\n",
              "    `contacts`.`department`\n",
              "  FROM\n",
              "    `main`.`dbdemos_aibi_cme_marketing_campaign`.`events`\n",
              "      JOIN `main`.`dbdemos_aibi_cme_marketing_campaign`.`contacts`\n",
              "        ON `events`.`contact_id` = `contacts`.`contact_id`\n",
              "  WHERE\n",
              "    `events`.`event_date` BETWEEN '2024-01-01' AND '2024-03-31'\n",
              "),\n",
              "department_event_counts AS (\n",
              "  SELECT\n",
              "    `department`,\n",
              "    COUNT(\n",
              "      CASE\n",
              "        WHEN `event_type` = 'click' THEN 1\n",
              "      END\n",
              "    ) AS `click_count`,\n",
              "    COUNT(\n",
              "      CASE\n",
              "        WHEN `event_type` = 'delivered' THEN 1\n",
              "      END\n",
              "    ) AS `delivered_count`\n",
              "  FROM\n",
              "    events_with_contacts\n",
              "  GROUP BY\n",
              "    `department`\n",
              "),\n",
              "department_ctrs AS (\n",
              "  SELECT\n",
              "    `department`,\n",
              "    (try_divide(`click_count`, `delivered_count`)) AS `ctr`\n",
              "  FROM\n",
              "    department_event_counts\n",
              "  WHERE\n",
              "    `delivered_count` > 0\n",
              ")\n",
              "SELECT\n",
              "  `department`,\n",
              "  `ctr`\n",
              "FROM\n",
              "  department_ctrs\n",
              "ORDER BY\n",
              "  `ctr` ASC\n",
              "LIMIT 5;"
