        "answer": [
          {
            "format": "SQL",
            "content": [
              "WITH filtered_campaigns AS (\n",
              "  SELECT\n",
              "    `campaign_id`,\n",
              "    `cost`\n",
              "  FROM\n",
              "    `main`.`dbdemos_aibi_cme_marketing_campaign`.`campaigns`\n",
              "  WHERE\n",
              "    `start_date` BETWEEN '2024-01-01' AND '2024-03-31'\n",
              "    AND `cost` < 2000\n",
              "),\n",
              "weighted_ctr_table AS (\n",
              "  SELECT\n",
              "    e.`campaign_id`,\n",
              "    (\n",
              "      SUM(\n",
              "        CASE\n",
              "          WHEN c.`device` = 'Mobile' THEN 2.0\n",
              "          WHEN c.`device` = 'Tablet' THEN 1.5\n",
              "          WHEN c.`device` = 'Laptop' THEN 1.2\n",
